    a.put("/lite/app/seo/pages/how-to-find-the-right-partner.html", '<div class="cover-pages" cover-to-display="learn-languages-online">\n  <div class="table-cell-centered">\n    <h1 set-title>How to find the right language exchange partner.</h1>\n\n    <h2>Speaky\'s matchmaking algorithm will help you find the right language exchange partner for you.</h2>\n\n    <div class="text-center">\n      <button type="button" class="btn btn-landing btn-landing-pages" sign-in translate>\n        Find a language partner\n      </button>\n    </div>\n  </div>\n</div>\n<div class="span-content-with-sidebar white-rounded-content content-pages mt10">\n  <div class="headings">\n\n    <!-- CUSTOM PART -->\n    <span ng-bind-html=\'uniqueContent\'>\n    </span>\n    <!-- END CUSTOM PART -->\n\n    <p> Here is a little guide that will explain you how you can find the right language partner using Speaky. </p>\n\n    <h2> 1. Complete your profile. </h2>\n\n    <p>Speaky uses an algorithm to help you find your language partner! Therefore, the more you tell us on what type of language exchange you are looking for, the better we can help you find the most relevant partner. </p>\n\n    <p>Be also aware that profiles that are not entirely completed have less chances of being displayed to other users. </p>\n\n    <p>Make sure your profile is entirely completed, with your language levels, a profile picture, a short description about you, your age and your interests. </p>\n\n    <h2> 2. Search for partners. </h2>\n\n    <p>Now that your profile is set up, you can go into the search tab to find your perfect language exchange partner. </p>\n\n    <p>The ideal language exchange is with a native speaker that is learning your language. So you better start looking for a native speaker learning your language.  </p>\n\n    <p>What is amazing with Speaky is that you don\'t have to do anything, the algorithm will automatically match you with partners that fits your profile. Just sort language partners by relevance and our artificial intelligence will do the rest.  And of course, if you want more diverse results you can always play with the "advance search" function. </p>\n\n    <p>Don\'t forget to add them as language buddies using the "add as a language buddy" button. Make a small and personalized text telling why you want to practice languages with that person and how you can help. </p>\n\n    <p>If you are not familiar with language exchange check out "what\'s a language exchange".</p>\n\n    <h2> 3. Check out the live chat. </h2>\n\n    <p>There are always tons of people looking for live practice in our live chat. It\'s a great way to meet people around the world and make the first steps to find yourself comfortable enough to practice the language with a stranger. </p>\n\n    <p>You can be really amazed by the people you will meet there as nearly everybody is there to help share cultures and learn languages. </p>\n\n    <p>Again, if you meet interesting people don\'t forget to add them as language buddies. </p>\n\n    <h2> 4. Enjoy and practice with your language buddies </h2>\n\n    <p>Ok now you are connected with potential lifelong partners so just relax and enjoy the experience.</p>\n\n    <p>Start engaging with your language buddies and agree on a schedule you can both keep to exchange languages together.</p>\n\n\n    <h2>Other pages you might be interested in</h2>\n\n    <display-siblings siblings="seo.siblings"></display-siblings>\n\n  </div>\n</div>')
